import Sega from '../Img/sega.jpg';


import gif from '../Img/FoodFeed.jpg';

  function Body() {

    return(
        <div>
            <img src={gif} 
  style={{  
    width:"auto",
    height:"400px"

  }}
  alt="gif" />
        <div style={{
  textAlign:"center",
  paddingTop:"30px",
  paddingBottom:"30px"
  }}>
      <p>FoodFeed - its all you are looking for  </p>

    <span className="copyright">Copyright &copy; Bakhtovar's Website 2020</span>
            </div>
        </div>
    );
  }
  export default Body;
